import pickle
import random
import string


def store_object(obj):
    outputFile = 'cipher_object.data'
    fw = open(outputFile, 'wb')
    pickle.dump(obj, fw)
    fw.close()
    return obj


def load_object():
    inputFile = 'cipher_object.data'
    fd = open(inputFile, 'rb')
    obj = pickle.load(fd)
    fd.close()
    return obj


